CREATE TABLE "DIGITAL_BJT" 
(
    "ID" SERIAL PRIMARY KEY,
    "Product (WPN)"	VARCHAR(512),
    "Datasheet"	VARCHAR(512),
    "OPN"	VARCHAR(512),
    "Price"	FLOAT,
    "Description"	VARCHAR(512),
    "Vi(on) Min (V)"	FLOAT,
    "Vi(off) Max (V)"	FLOAT,
    "R1 (kΩ)"	FLOAT,
    "R2 (kΩ)"	FLOAT,
    "IC Continuous (A)"	FLOAT,
    "Configuration"	VARCHAR(512),
    "Polarity"	VARCHAR(512),
    "Package Type"	VARCHAR(512),
    "V(BR)CEO Min (V)"	INT,
    "hFE Min"	INT,
    "R1/R2 Typ"	FLOAT,
    "Qualification"	VARCHAR(512),
    "AEC Qualified"	BOOLEAN,
    "PPAP Capable"	BOOLEAN,
    "Halide Free"	BOOLEAN,
    "Lead Free"	BOOLEAN,
    "Status"	VARCHAR(512)
);

